const ENDPOINT = 'http://localhost:4003/db/gifs'

export default function FavService({ id, jwt }) {
  console.log('token',{ jwt})
  return fetch(`${ENDPOINT}`, {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
      "Authorization": `bearer `
    },
    body: JSON.stringify({  "gif_id":  id })
  })
    .then((res) => {

      if (!res.ok) throw new Error("Response is not ok");
      return res.json();
    })
    .then((res) => {

      const favs  = res.gif_id;

      return favs;
    });
}
